import { IconButton, List, ListItemButton } from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';
import { StyledListItemButton } from "../../styles/dashboard/DashboardAccordian";
import { MiddleDivider } from "../../styles/dashboard/DashboardSidebar";
import ProductionQuantityLimitsIcon from '@mui/icons-material/ProductionQuantityLimits';
import AddIcon from '@mui/icons-material/Add';

export default function SidebarAccordian(){


return(
    <>
    <List>
        <StyledListItemButton sx={{display:"flex"}}><IconButton><DashboardIcon sx={{color:"#fff"}}/> </IconButton> Dashboard   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton sx={{display:"flex"}}><IconButton><ProductionQuantityLimitsIcon sx={{color:"#fff"}}/> </IconButton> Products   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton sx={{display:"flex"}}><IconButton><ProductionQuantityLimitsIcon sx={{color:"#fff"}}/> </IconButton> Add Products   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton sx={{display:"flex"}}><IconButton><ProductionQuantityLimitsIcon sx={{color:"#fff"}}/> </IconButton> Products   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
    </List>
    </>
)

}
